const campaigns = items.map(item => {
  return {
    date: item.json["Date"],
    name: item.json["Campaign Name"],
    channel: item.json["Channel"],
    spend: parseFloat(item.json["Spend (â‚¹)"].replace(/,/g, '')),
    impressions: parseInt(item.json["Impressions"].replace(/,/g, '')),
    clicks: parseInt(item.json["Clicks"].replace(/,/g, '')),
    ctr: parseFloat(item.json["CTR (%)"]),
    conversions: parseInt(item.json["Conversions"]),
    roas: parseFloat(item.json["ROAS"])
  };
});

// Filter out invalid rows
const validCampaigns = campaigns.filter(c =>
  !isNaN(c.spend) &&
  !isNaN(c.impressions) &&
  !isNaN(c.clicks) &&
  !isNaN(c.ctr) &&
  !isNaN(c.conversions) &&
  !isNaN(c.roas)
);

// If no valid data
if (validCampaigns.length === 0) {
  return [{ json: { error: "No valid campaign data found." } }];
}

// Calculate top performers
const topCTR = validCampaigns.reduce((max, c) => (c.ctr > max.ctr ? c : max), validCampaigns[0]);
const topROAS = validCampaigns.reduce((max, c) => (c.roas > max.roas ? c : max), validCampaigns[0]);

// Totals
const totalSpend = validCampaigns.reduce((sum, c) => sum + c.spend, 0);
const totalImpressions = validCampaigns.reduce((sum, c) => sum + c.impressions, 0);
const totalClicks = validCampaigns.reduce((sum, c) => sum + c.clicks, 0);

return [
  { json: { topCTR } },
  { json: { topROAS } },
  {
    json: {
      totalSpend,
      totalImpressions,
      totalClicks
    }
  },
  { json: { campaigns: validCampaigns } }
];

// Step 1: Separate inventory and orders
const inventoryItems = items.filter(item => item.json.SKU);   // Inventory data
const orderItems = items.filter(item => !item.json.SKU);     // Orders data

// Step 2: Top Selling Products (based on Units Sold in inventory)
const topSellingProducts = inventoryItems
  .map(item => ({
    product: item.json.Product,
    sku: item.json.SKU,
    unitsSold: Number(item.json['Units Sold'])
  }))
  .sort((a, b) => b.unitsSold - a.unitsSold);

// Step 3: Low Stock Warnings (threshold: 40 units)
const lowStockWarnings = inventoryItems
  .filter(item => Number(item.json['Closing Stock']) <= 40)
  .map(item => ({
    product: item.json.Product,
    sku: item.json.SKU,
    closingStock: Number(item.json['Closing Stock'])
  }));

// Step 4: High Return Products (from orders)
const productReturns = {};

for (const order of orderItems) {
  const product = order.json.Product;
  const returnAmt = Number(order.json['Return Amount'] || 0);

  if (!productReturns[product]) {
    productReturns[product] = 0;
  }
  productReturns[product] += returnAmt;
}

const highReturnProducts = Object.entries(productReturns)
  .filter(([_, value]) => value > 0)
  .map(([product, returnAmount]) => ({
    product,
    returnAmount: parseFloat(returnAmount.toFixed(2))
  }));

// Final Output (without inventoryWarnings)
return [
  {
    json: {
      topSellingProducts,
      lowStockWarnings,
      highReturnProducts
    }
  }
];

const data = items.map(item => item.json);

let totalOrders = data.length;
let totalRevenue = 0;
let totalUnitsSold = 0;
let totalReturns = 0;
let totalCost = 0;

const productStats = {};

for (const order of data) {
  const product = order["Product"];
  const qty = Number(order["Quantity"]);
  const unitPrice = Number(order["Unit Price"]);
  const totalPrice = Number(order["Total Price"]);
  const returnAmount = Number(order["Return Amount"]);
  const costPrice = Number(order["Cost Price"]);

  totalRevenue += totalPrice;
  totalUnitsSold += qty;
  totalReturns += returnAmount;
  totalCost += qty * costPrice;

  if (!productStats[product]) {
    productStats[product] = {
      type: "productPerformance",
      product: product,
      quantitySold: 0,
      revenue: 0,
      returns: 0,
      margin: 0
    };
  }

  productStats[product].quantitySold += qty;
  productStats[product].revenue += totalPrice;
  productStats[product].returns += returnAmount;
  productStats[product].margin += (unitPrice - costPrice) * qty;
}

// Final margin after adjusting for returns
const totalMargin = totalRevenue - totalCost - totalReturns;
const aov = totalRevenue / totalOrders;

const summary = {
  totalOrders,
  totalRevenue: Number(totalRevenue.toFixed(2)),
  totalUnitsSold,
  totalReturns: Number(totalReturns.toFixed(2)),
  totalMargin: Number(totalMargin.toFixed(2)),
  aov: Math.round(aov)
};

// Adjust product margins for returns and finalize
const productPerformance = Object.values(productStats).map(product => {
  if (product.returns > 0) {
    product.margin -= product.returns;
  }
  product.margin = Number(product.margin.toFixed(2));
  product.revenue = Number(product.revenue.toFixed(2));
  product.returns = Number(product.returns.toFixed(2));
  return product;
});

return [
  {
    json: summary
  },
  ...productPerformance.map(p => ({ json: p }))
];

const result = {};

for (const item of $items()) {
  Object.assign(result, item.json);
}

return [{ json: result }]

// Assumes input is an array of rows with fields like:
// Date, Visitors, Page Views, Bounce Rate (%), Avg. Session Duration (sec), Product Views, Add to Cart, Purchases, Conversion Rate (%)

const data = items.map(item => item.json);

const toNumber = val => typeof val === 'string' ? parseFloat(val.replace(/,/g, '')) : val;

// Aggregate totals
let totalVisitors = 0;
let totalProductViews = 0;
let totalAddToCart = 0;
let totalPurchases = 0;
let bounceRates = [];
let conversionRates = [];

// Split for growth comparison: first 6 vs last 7
const firstPeriod = data.slice(0, 6);
const lastPeriod = data.slice(6);

const avg = arr => arr.reduce((sum, v) => sum + v, 0) / arr.length;

// --- Main aggregation ---
for (const row of data) {
  totalVisitors += toNumber(row["Visitors"]);
  totalProductViews += toNumber(row["Product Views"]);
  totalAddToCart += toNumber(row["Add to Cart"]);
  totalPurchases += toNumber(row["Purchases"]);
  bounceRates.push(toNumber(row["Bounce Rate (%)"]));
  conversionRates.push(toNumber(row["Conversion Rate (%)"]));
}

// Funnel drop-offs
const productViewToCart = (totalAddToCart / totalProductViews) * 100;
const cartToPurchase = (totalPurchases / totalAddToCart) * 100;

// Growth: visits
const firstAvgVisits = avg(firstPeriod.map(r => toNumber(r["Visitors"])));
const lastAvgVisits = avg(lastPeriod.map(r => toNumber(r["Visitors"])));
const sessionChange = ((lastAvgVisits - firstAvgVisits) / firstAvgVisits) * 100;

// Growth: bounce rate
const firstAvgBounce = avg(firstPeriod.map(r => toNumber(r["Bounce Rate (%)"])));
const lastAvgBounce = avg(lastPeriod.map(r => toNumber(r["Bounce Rate (%)"])));
const bounceRateChange = ((lastAvgBounce - firstAvgBounce) / firstAvgBounce) * 100;

// Growth: conversion rate
const firstAvgConv = avg(firstPeriod.map(r => toNumber(r["Conversion Rate (%)"])));
const lastAvgConv = avg(lastPeriod.map(r => toNumber(r["Conversion Rate (%)"])));
const conversionRateChange = ((lastAvgConv - firstAvgConv) / firstAvgConv) * 100;

// Final output
return [
  {
    json: {
      trafficInsights: {
        visits: totalVisitors,
        bounceRate: `${avg(bounceRates).toFixed(1)}%`,
        conversionRate: `${avg(conversionRates).toFixed(2)}%`,
        funnelDropOff: {
          productViewToCart: `${productViewToCart.toFixed(2)}%`,
          cartToPurchase: `${cartToPurchase.toFixed(2)}%`
        },
        growth: {
          sessionChange: `${sessionChange.toFixed(2)}%`,
          bounceRateChange: `${bounceRateChange.toFixed(2)}%`,
          conversionRateChange: `${conversionRateChange.toFixed(2)}%`
        }
      }
    }
  }
];

const data = items.map(item => item.json);

const highValue = [];
const loyal = [];
const risky = [];

data.forEach(cust => {
  const name = cust['Customer Name'];
  const email = cust['Email'];
  const recency = Number(cust['Recency (days)']);
  const totalOrders = Number(cust['Total Orders']);
  const monetary = Number(String(cust['Monetary (â‚¹)']).replace(/,/g, ''));

  // Classify based on rules
  if (monetary >= 8000) {
    highValue.push({ name, email, monetary });
  }

  if (totalOrders >= 6) {
    loyal.push({ name, email, totalOrders });
  }

  if (recency >= 60) {
    risky.push({ name, email, recency });
  }
});

return [{
  json: {
    totalCustomers: data.length,
    highValueCustomers: highValue,
    loyalCustomers: loyal,
    riskyCustomers: risky
  }
}];

const result = [];

for (const item of items) {
  for (const key in item.binary) {
    const fileInfo = item.binary[key];

    result.push({
      json: {
        fileName: fileInfo.fileName,
        mimeType: fileInfo.mimeType,
        fileSize: fileInfo.fileSize,
        fileKey: key
      },
      binary: {
        [key]: fileInfo
      }
    });
  }
}

return result;
